"title": "Personalized Flasks",
"announcement": "FAST Turnaround Time.  FREE SHOT CUP with every flask ordered! Wedding flasks, hip flasks, whiskey flasks, personalized in our home studio and wood shop near Vancouver, Washington. Come on in and browse and let us know if you have questions, we specialize in personal service! ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "We are taking a vacation. We will reopen August 30. \r\n\r\nPlease message us at Engravingpro2@gmail.com or visit us at www.etsy.shop/engravingpro\r\n\r\nThank you for visiting our shop! \r\n\r\nRespectfully,\r\nAK Laser\r\nKellie and Adam",
"sale_message": "Thank you for visiting our Etsy shop, www.etsy.com/shopaklaser and for making a purchase! This e-mail confirms your purchase.\r\n\r\nWe process some orders as soon as we receive them, and ship most orders within 3 to 5 business days. The order invoice includes the ship date (located above your name and address).  We will email you a shipping notification and TRACKING when your package has shipped. \r\n\r\nWe guarantee our custom work 100 percent. If there&#39;s a mistake we made with your order, feel free to contact us via &#39;Etsy conversations&#39;, we will ship you another (corrected) item at our cost!\r\n\r\nPackages shipped INTERNATIONALLY can take up to 3 or 4 weeks for delivery. If this conflicts with your deadline, please contact us as soon as possible via &#39;Etsy conversation&#39;. \r\n\r\nOur INTERNATIONAL customers will be responsible for all import taxes, duties, VAT and/or handling fees that may be applied on different imported merchandise by your countries. The fees, are collected at the time of customs clearance, and your merchandise/package may be held at your local (Postal Office) or other location until the fees are paid. Please see our shop policies for more information.\r\n\r\nPlease note:\r\n+++Please wash the engraved FLASKS (by hand) thoroughly inside and out before using.\r\n\r\nPlease contact us if your have any questions and/or concerns!\r\nwww.etsy.com/shop/aklaser\r\n360.667.0380\r\n\r\nRespectfully,\r\nAK Laser",
"digital_sale_message": null,
"last_updated_tsz": 1432169786,
"listing_active_count": 18,
"login_name": "AKLaser",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to our shop and thank you for visiting! \r\n\r\nIf you have questions, concerns and/or issues please do not hesitate to contact us!!\r\n\r\nOur contact information is via &#39;Etsy conversation&#39; -we check our Etsy messages hourly during normal business hours and every few hours on weekends. We also receive phone calls during normal business hours. ",
"policy_payment": "We accept PayPal and credit card payment in US Dollars. Payment must be made in full and have cleared before the item is shipped.\r\n\r\nWashington State residents will be charged sales tax of 8.4% upon checkout. ",
"policy_shipping": "Most orders will be processed, and packages shipped within 5 business days, unless mentioned otherwise in our shop banner, listing&#39;s description or order form receipt.\r\n\r\nPackages will be shipped to the name and address that you provided in your PAYPAL or Etsy account.\r\n\r\nWe ship through the UNITED STATES POSTAL SERVICE (USPS). In the United States, we ship packages First Class Mail, Priority Mail or Parcel Select (Ground). The following shipping delivery times are estimates: \r\n\r\n***Packages shipped First Class Mail can be expected in 2-5 days;\r\n***Priority Mail (2-3 days or more during holidays);\r\n***Parcel Select (2-9 days). \r\n\r\nMost of our flask sets are shipped USPS Parcel Select. All packages of orders purchased from within the U.S. are tracked to their destination. \r\n\r\nIf you require a RUSH ORDER, please message us before you order so we can tailor your needs to the appropriate USPS shipping delivery method. We process rush orders in 1 to 2 days and packages can be expected within 3 or 4 business days. This may include a guaranteed delivery time in the U.S, depending on the shipping upgrade that is purchased. \r\n\r\nINTERNATIONAL ORDERS are welcome for all of our shop listings! International packages are shipped USPS First Class International or Priority Mail International (if packages weigh over 4 pounds). First Class International packages can take up to 4 weeks for delivery. Packages shipped Priority International can be expected in 6-11 days. Please order early. Contact us via Etsy conversations -if questions. \r\n\r\nINTERNATIONAL packages shipped internationally are TRACKED ONLY to the International sorting center in the U.S.\r\n\r\nINTERNATIONAL CUSTOMERS will be responsible for all fees imposed by their countries. These fees include and are not limited to IMPORT TAXES, VAT and/or handling fees. The fees, may be applied on different imported merchandise by your countries and post offices and are collected at the time of customs clearance. Your merchandise/package may be held at your local (Post Office) or other location until the fees are paid. Our listing&#39;s shipping prices do not include any of the aforementioned fees.\r\n\r\nTo our shop visitors from the UK -please review the following information (in the link provided below) before purchasing our items:\r\nwww.hmrc.gov.uk/customs/post/buying.htm#3\r\n\r\nBelow is a sample of fees charged for four flask sets to the UK:\r\n  ¬£10.32 in VAT;\r\n  ¬£8 Royal Mail international handling fee;\r\n  Total ¬£18.32 plus the cost of the four flask sets.\r\n\r\n(The above was received from a customer of the UK in 2014).\r\n\r\nAll packages will be shipped with the full value (item price) and as merchandise. \r\n \r\nWe will email you when your package has shipped. ",
"policy_refunds": "We are very sorry that we can not give refunds for personalized engraved merchandise. Still, please message us, we are always willing to work out something!! \r\n\r\nIf there is a mistake with our engraving, or a problem with the merchandise, please contact us via &#39;Etsy conversations&#39; within five days of receiving your package.\r\n\r\nWe will only read engraving information if it is written in the note box on the order form, or if it references an e-mail or  &#39;&#39;Etsy conversation&quot;. ",
"policy_additional": "Please make sure when you order that all ENGRAVING INSTRUCTIONS are written in the &#39;note box&#39; on the &#39;add to cart &#39; page, and all names, titles and wedding dates and other information if required are correct. \r\n\r\nWe do not provide PROOFS of personalization for any of the engraving designs listed in our shop.\r\n\r\nFor most orders we will engrave exactly or close to what is requested on the order form, except for two exceptions, i.e., if the customer requests that &quot;Groomsmen&quot; or &quot;Bestman&quot; be engraved for a flask or knife order, we will engrave &quot;Groomsman&quot; and &quot;Best Man&quot;. Dates will be engraved exactly or close to what is requested, August 14,2015, 14 Aug 2015, August 14th 2015, etc.\r\n\r\nAll of the ENGRAVED IMAGES on the flasks are intellectual property, created by us. All of our shop&#39;s listing PHOTOS and NARRATIVE are Intellectual Property. Copying our images, photos or narrative is intellectual property right infringement. \r\n\r\n+++Please wash the engraved FLASKS and shot cups (by hand) thoroughly inside and out before using.\r\n\r\nWHEN YOU ORDER from AKLASER, you understand and agree to our shop policies.",
