"title": "3 Liter Engraved Bourbon Barrel: great gift for men",
"description": "Looking for a unique birthday, Valentine&#39;s Day or wedding gift for a man? The 3 liter mini handcrafted whiskey/bourbon barrel cask might be just what the doctor ordered. The barrel hold 3 liters and is crafted from Kentucky and American Oak wood with steel hoops going around it (your choice of silver or black steel). No previous knowledge of expertise of blending is needed because each barrel comes with its own set of detailed guidelines for using and cleaning. The barrel can also be used to make or store your own varieties of wine, rum and tequila! Each barrel measures 8.5&quot; x 5.5&quot; x 5.5&quot; and comes with its own hand carved wood stand.\r\n\r\nThe barrels are also offered in 2 liter size: http://www.etsy.com/listing/94178325/engraved-mini-whiskey-barrel-great-for and  1 liter size: http://www.etsy.com/listing/101458387/1-liter-personalized-mini-whiskey-barrel\r\n\r\nWHAT&#39;S THE PROCESS?\r\nThe process is very simple. Before the barrel&#39;s first use, you&#39;ll have to perform the curing (cleaning) it. The included instructions will thoroughly explain how to do this. It&#39;s very easy. Once the barrel is cured, fill it with your favorite whiskey or bourbon. For extra flavor, add extra ingredients like cinnamon sticks, apple chips, honey and chocolate. After this, it&#39;s up to you to determine how long you let everything sit. Once you&#39;ve finished one batch, you can empty your creation into a decanter and restart the process. If you&#39;re not a big whiskey drinker, you can also use the barrels to blend or store your own wine, rum and tequila. \r\n\r\nENGRAVING OPTIONS\r\nI will engrave the front of your barrel(s) at no extra cost. There is a visual example of the 4 engraving style in the product images above. Please select the engraving style you want from the drop down box above. Your options are are:\r\n1. Standard Initials\r\n2. Monogram (small first name initial, large last name initial, small middle name initial)\r\n3. One or Two Custom Lines of Text (max of 15 characters per line)\r\n4. Single Large Initial\r\n\r\n*You can also select blank and not have any engraving on the barrel.\r\n** Please note that &quot;standard initials&quot; and &quot;monogram&quot; aren&#39;t the same thing.\r\n\r\nHOW TO SEND ME YOUR ENGRAVING REQUEST(S)\r\nPlease select the engraving style you want from the drop down box above. When finalizing your order, you&#39;ll have the ability to include a &quot;message to seller&quot;. Use this area to tell me what you want engraved on your barrel(s). If I don&#39;t receive a message with your engraving request, it will be assumed you want your barrel to arrive without engraving.\r\n\r\nORDERING MORE THAN 1 BARREL?\r\nYou can select your quantity at this page or at checkout.\r\n\r\nSHIPMENT\r\nOrders are currently shipping out  approximately 2-3 business days after you order. After this, there are another 2-4 business days in transit via UPS Ground.  If you need a rush order, please contact me BEFORE ORDERING to discuss available options.\r\n\r\nINTERNATIONAL SHIPPING\r\nCanadian customers are free to make a purchase through this page with the already-provided shipping costs. Your ship time will increase by 1-2 business days versus an order going to the US.  For residents of other countries, please message me with your address and the number of barrels you want. After I have this info, I can provide you a shipping quote and we can complete the transaction.\r\n\r\nSHOP POLICIES & FAQ\r\nFor answers to common questions on this product, shipping timeframes, refunds and other details, please consult with this page: http://www.etsy.com/shop/themanregistry/policy",
