"title": "Big Love Vintage: a mulit-state vintage venture!",
"announcement": "We&#39;re on Twitter!  Follow us at twitter.com/biglovevintage and you&#39;ll be first to know about our latest vintage finds.  Early bird gets the worm!!!\r\n\r\nTo join our email list and be notified about sales and such, send an email to biglovevintage@gmail.com\r\n\r\nWe search Texas and South Carolina and anywhere we land in between to find our vintage treasures you see here.  \r\n\r\nWith 25 + years of vintage hunting under our belt, we know how to find good vintage - really good vintage.  And if you&#39;re heart&#39;s desire is something vintage-specific, LET US KNOW!  We may just come across it in our travels, and we&#39;ll gladly pass it on to you!  Feel free to convo us anytime.",
