"policy_refunds": "We try to describe, via written word and the pictures we post, our items as best we can.  We want you to know exactly what you are purchasing.  Our items are vintage, so they will show signs of age and wear - but if there&#39;s any damage or notable characteristic we&#39;ll tell you in the item listing.  So read carefully.\r\n\r\nIf, for some reason, you are not 100% satisfied with your purchase, you may return it for store credit. Here are the terms:\r\n\r\n1.  A convo must be sent to make us aware of the pending return within 1 week of you receiving the shipped item.\r\n\r\n2.  We must receive the returned item within 30 days of your date of receipt.\r\n\r\n3.  Buyer is responsible for return shipping postage, and prior postage paid is non-refundable.",
