"policy_payment": "Payments are accepted through Direct Checkout via Etsy, Etsy Gift Cards, and Paypal. All payments are due within 3 business days.  Orders will not begin production until payments have cleared.",
"policy_shipping": "****PRIORITY SHIPPING!!!****\r\n\r\nAll tumblers are carefully packaged in bubble wrap and package tightly.  All other items are packaged with tissue paper or specialty wrapping.\r\n\r\nWe USPS Priority Mail to ship all packages (excluding large packages).  With this you will receive tracking information and you will receive your items in 1-3 days (domestic) 6-10 (international), once shipped.  Please know, USPS does not always guarantee delivery in this time frame, they do their best.  \r\n  \r\n**Priority mail does come with insurance.  If you have received a damaged packaged please file a claim with USPS:\r\nhttps://www.usps.com/ship/file-domestic-claims.htm\r\n\r\n**Large packages may be shipped Standard depending on weight.  We will always include insurance incase anything happens.\r\n\r\nPlease convo me for any special shipping requests or upgrades. Or if you have any questions prior to purchase.\r\n\r\n*****All custom orders MUST be approved by the buyer before shipping.  You will receive a photo of the completed order to ensure all details are correct.  We gladly correct any mistakes made by us.  If you have provided incorrect information on your order or if you choose to make changes to a finished product, there will be a re-do fee.   If you have not responded within 2 days, your order will be shipped as is.*****",
"policy_refunds": "ALL SALES ARE FINAL. No refunds are given for lost or damaged items in transit. All Custom Order Sales Are Final. Please contact me about exchange policy. May Be Subject to return fee. Please read descriptions carefully. If you are unsure of colors or sizes, please contact me before you complete your purchase. Computer screen colors may vary. So convo me with any questions before purchases to insure a smooth transaction. Thank you!",
"policy_additional": "MadeByCRose, welcomes custom orders. If you are interested in placing a custom order please convo me. Please understand that when placing a custom order payment is due before your order is created.\r\n---&gt;  All items are made in a Smoke Free/Pet Free studio.\r\n\r\n---&gt; Any delays in proof confirmation will delay shipment time.   Please respond promptly to ensure delivery on time. \r\n\r\n---&gt; All rush orders will be shipped out on time.  We are not responsible for any delays from USPS.   Please remember Holiday shipping can be delayed on the Postal Service end.\r\n\r\n---&gt; All drink ware is personalized with a high grade/waterproof vinyl.  The vinyl can be withstand heat and water.  Some of the drink ware is hand wash only.\r\n\r\n---&gt;  All signs are printed on Epson&#39;s Premium Presentation Paper; Ultra smooth, non-glare, heavy-weight matte-finish paper for long-lasting photos.   Again, these are PRINTS not actual Chalkboards or Canvas.\r\n",
