"sale_message": "STOP: PLEASE CHECK YOUR SHIPPING ADDRESS, IF INCORRECT, PLEASE NOTIFY US IMMEDIATELY. PACKAGES SHIPPED TO  THE WRONG ADDRESS WILL NOT BE REPRODUCED. WE WILL RE-SHIP AT YOUR EXPENSE ONCE THE PACKAGE HAS RETURNED. WE ARE NOT RESPONSIBLE FOR PACKAGES SHIPPED TO THE WRONG ADDRESS.  \r\n\r\nSTOP: WE DO NOT GUARANTEE DELIVERIES BY ANY DEADLINE. ALL OF OUR PRODUCTS ARE MADE-TO-ORDER AND PERSONALIZED. SHIPPING TIME IS ESTIMATED ONLY. GENERALLY SPEAKING, WE NEED 2 WEEKS FROM ORDER TO DELIVERY. \r\n\r\nPlease email orders@tealsprairie.com for after-sales support. Include order # in subject line. But first, here are our top 4 FAQs.\r\n\r\nQUESTION: WHERE IS MY ORDER?\r\n\r\nreply: you see, if you placed an orders and within 36 hours (excluding weekends) you did NOT hear from us by email with proofs to confirm or additional questions, this means we understood your customization request and put the order immediately into production. from order to delivery, we need 7 - 10 business days. tracking numbers are automatically emailed; however some email servers reject these emails, in which case, we apologize for the inconvenience, but kindly ask that you be patient until the 10 business days delivery time has expired before contacting us by email for an update. CHECK YOUR SPAM FOLDER \r\n\r\nNote: 95% of the time orders placed by Thursday are delivered by that following Friday. If this wasn&#39;t helpful, send us an email, as we are no longer doing after-sales support directly on Etsy. \r\n\r\n\r\nQUESTION: MY ORDER ARRIVED BROKE, ENGRAVED WRONG, ETC. WHAT&#39;S NEXT?\r\n\r\nreply: you see, we always and without question replace broken, incorrectly engraved items, free of charge, so please don&#39;t worry. just email us, let us know exactly what needs to be replaced along with a few supporting images (if convenient). typically speaking, lead-time for replacements are the same as the original order. If this wasn&#39;t helpful, send us an email, as we are no longer doing after-sales support directly on Etsy. \r\n\r\nQUESTION: I FORGOT TO LEAVE PERSONALIZATION DETAILS \r\n\r\nreply: you see, just send those details to the email address above with order # in subject line. we do not ship blank, non-personalized items. If this wasn&#39;t helpful, send us an email, as we are no longer doing after-sales support directly on Etsy. \r\n\r\nQUESTION: I NEED TO CHANGE MY SHIPPING ADDRESS \r\n\r\nreply: you see, as long as the order hasn&#39;t shipped, we can change the shipping address. simply email the shipping address with order # in subject line. If this wasn&#39;t helpful, send us an email, as we are no longer doing after-sales support directly on Etsy. \r\n\r\nWe appreciate your business. \r\n\r\nTeals Prairie & Co.",
