"announcement": "Welcome to J&A Apparel! We are your one stop shop for all clothing that is bound to make a statement. From laid-back and funny, to country and sassy, we have it all and everything in between. \r\n\r\nALL RUSH ORDERS NEED TO PURCHASE RUSH ORDER LISTING FOUND IN OUR SHOP AS WELL AS UPGRADED SHIPPING :) Thank you for your understanding and cooperation in this matter. We work extremely hard to assure all packages are delivered by their need by date, but if you have an order with urgency and need to be bumped in the production line then these upgrades MUST be purchased.\r\n\r\nAll of our items are hand designed from beginning to end, and new designs are added daily so favorite our shop to be the first with our latest fashions.  We enjoy creating custom designs for our customers and encourage potential customers to contact us if they have a specific style in mind. Here at J&A Apparel we strive for 150% customer satisfaction, so if you have a question about anything please let us know and we will work our hardest for figure it out. \r\n\r\nAll of our designs are available on any shirt, tank, hoodie, etc. in our shop. So if you see something you would like on a different style just let us know.\r\n\r\nYou can find us on Instagram @jandaapparel! We LOVE to see our customers in our fashions, so snap a pic and tag us. If we use your photo in our shop you will receive a SPECIAL coupon code to use for a future order!\r\n\r\nThanks for stopping by &lt;3\r\nJ and A",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your purchase. PayPal offers amazing buyer protection programs to ensure that you have 100% buyer satisfaction. We hand design each and every item in our shop &lt;3 \r\nBelow you will find your care instruction for your clothing item.\r\n**Wash inside out\r\n**Tumble Dry on Low or Hang to Dry for Best Results\r\n**Do not iron directly onto image\r\nPlease message us if you have any questions.\r\nThank you again for your business!\r\nJ&A Apparel",
"digital_sale_message": null,
