"login_name": "hennyweis1",
"accepts_custom_requests": true,
"policy_welcome": "Welcome and Thank You for stopping by J&A Apparel. Every item in our shop is hand-crafted &lt;3 Creating clothing has been such an amazing pleasure, and we are extremely grateful for the opportunity to design for the world. \r\n\r\nOur goal is to create a line that allows customers to create custom designs that can be worn everyday. New listing will be added daily, but if you have a special design in mind that you would like us to create for you just shoot us a message or email and we will do our best to bring your vision to life.",
"policy_payment": "We accept Visa, Mastercard, American Express, Discover and all major credit cards through PayPal. We believe strongly that our customers should have a customer service number to refer to when purchasing over the internet, this is just another reason why we process directly through PayPal. E-Checks are also accepted via PayPal. We use PayPal not only for processing but as our preferred source of purchasing as a buyer. PayPal offers amazing Buyer Protection Programs and have never let us down. Customers DO NOT need to have a PayPal Account in order to purchase. All major credit cards are accepted.\r\n\r\n",
"policy_shipping": "{Shipping Method}\r\n\r\n‚Ä¢ I ship via USPS to offer you the most economical shipping method possible.\r\n‚Ä¢ First Class Domestic orders will take between 3 to 5 business days for travel.\r\n‚Ä¢ USPS offers delivery confirmation number not tracking numbers (This is often confused). While the number can give a general idea of where your package may be it does not always reflect its status and is often delayed.\r\n‚Ä¢ If you are in need of an by a specific date please Message Us PRIOR to Ordering\r\n\r\n{Lost, Stolen, and Undelivered Shipments}\r\n\r\nUSPS failures are not my fault or a reflection on my level of dedication to my customers. If your shipment is sent without insurance:\r\n\r\n‚Ä¢ J&A Apparel is not responsible for lost, stolen or undelivered packages. All lost, stolen, and undelivered packages without insurance are on the responsibility of the buyer. Insurance can be purchased during checkout.\r\n‚Ä¢ We are unable to replace or reship items purchased without insurance.\r\n\r\n\r\n{Shipment & Address Changes}\r\n\r\n‚Ä¢ I will ship to the shipment address listed in the order confirmation. This includes Paypal addresses.\r\n‚Ä¢ Any packages returned due to wrong or incorrect addresses will be reshipped at the cost of purchaser. \r\n\r\n{International Orders}\r\n\r\n‚Ä¢ International orders are average 5-15 business days for delivery depending on customs and location.\r\n‚Ä¢ J&A Apparel is not responsible for customs delays, lost or stolen packages\r\n‚Ä¢ International package IDs are not tracking numbers, but parcel numbers to confirm your shipment\r\n‚Ä¢ If you want a tracking ID it will need to ship FedEx or UPS and send us a convo before you purchase.",
"policy_refunds": "EXCHANGES AND REFUNDS | Due to the handcrafted nature of our items all sales will be FINAL SALE ONLY. We ask that every please read and understand that custom orders are impossible to resell, and for that reason we issue no refunds. With this in mind, J&A Apparel reserved the right to issue refunds if we have made a mistake on an order, we but human.  Exchanges are at the discretion of J&A Apparel and will be made on a case by case basis.\r\n\r\nINCORRECT OR DAMAGED ITEMS | If you receive an incorrect shipment and/or damaged items, please notify us within 3 days of receipt so we can arrange to have the correct item shipped to you and/or fix any damaged purchases.\r\n\r\nBy purchasing from J&A Apparel you agree to our policies.",
"policy_additional": "Leaving me feedback? PLEASE remember this is my livelihood and anything negative hurts not only my business but my opportunities to grow. I am pretty reasonable to work with and will make any mistake or issue right...so please, be nice.",
