"description": "Personalized Groomsman whiskey, scotch glasses are custom engraved and personalized groomsmen gifts with both the title of your best man or groomsman and his name, making these whisky glasses the perfect groomsmen gift idea. Set of 5, and a different name can be used on each glass. These groomsmen barware gifts are stunning with their deeply engraved background panel that is carved away to leave the words and design raised from the bourbon glass surface. These beautifully carved wedding party double old fashioned glasses are truly a keepsake gift to show your appreciation to your groomsmen and best man and is perfect for use during the wedding reception and for that special toast to the bride and groom. These engraved groomsmen whiskey glasses are an engraved groomsmen gift he will enjoy for years to come. At 4.25 high x 3.4&quot; wide, our whiskey glasses and scotch glasses hold 13.5 oz. Dishwasher safe.  \n\n**NOTE: Please tell us in a note during checkout, exactly what you want on each glass. Put the title of your attendant and then his name for each of the glasses. Example: Best Man = Eric, Groomsman=Luke and so forth. Sample titles: Best Man, Groomsman, Usher, Groom, Father of the Bride, Father of the Groom, Officiant, Man of Honor, Bridesman, Bride, Mother of the Bride, Mother of the Groom, Bridesmaid, Maid of Honor, Matron of Honor.",
