"sale_message": "‚ú•~~ I hope you enjoyed your stay, darlings & I will love you forever for leaving positive feedback about your order- unless there is a problem, but do contact me first so I can make it right! ! ~~‚ú•\r\nAlso, All your future orders are 20% off!  Yes that&#39;s right, that&#39;s how i roll. Just use coupon code : RETURN20",
