"description": "Liquid Courage Flasks‚Ñ¢ are brand new stainless steel flasks that hold six ounces of your favorite liquor.  These hip flasks fit perfectly in your pocket or purse.  Flasks make awesome gifts for any occasion...or for yourself!  Perfect for bridesmaids, groomsmen, work friends, birthday presents, guys gifts, big/little sorority gifts, stocking stuffers, and much more!\n\nFeel free to give us a shout with any questions (888) 959-2870 M-F 9am - 5pm Central or send us a convo anytime!\n\nDETAILS:\nLiquid Courage Flasks‚Ñ¢ are unique handmade creations designed, printed, and applied in Tennessee.  All of the designs/patterns wrap completely around the flask and overlap in the back.  Each design is professionally printed on high quality vinyl and permanently adhered to the flask.  The layout/positioning of the design will vary slightly since each flask is a unique piece, and the colors displayed on your monitor may be slightly different from the actual flask. \n\nFLASK SIZE:\nSix Ounce Flask (6 oz)\nDimensions: 3.75&quot; Length, 1.00&quot; Width, 4.50&quot; Height\n\nCUSTOM FLASKS:\nHave your own image or flask idea? Convo us for custom orders. If you don&#39;t see what you are looking for or have a question...feel free to contact us.\n\nWHOLESALE INQUIRIES:\nLiquid Courage flasks are available in select boutiques throughout multiple countries. If you are interested in carrying our line of flasks in your retail space, please contact us for details.\n\nKEEP SHOPPING:\nhttp://www.etsy.com/shop/LiquidCourage\nhttp://liquidcourageflasks.com\n\nVINETTA MAE:\nBe sure to check out our other Etsy shop, Vinetta Mae! It is a monogram boutique with a full lineup of custom phone cases, canvases, prints, signs, and more! \nhttp://www.etsy.com/shop/VinettaMae\n\nThank you for visiting Liquid Courage!\nTyler & Amy Fisk",
